import React from 'react';
import lightStreak from '../assets/light-streak.png';

const ImageSection = () => {
  return (
    <section className="relative h-96 overflow-hidden bg-black">
      {/* Background Image with Rotation */}
      <div 
        className="absolute inset-0"
        style={{
          backgroundImage: `url(${lightStreak})`,
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          transform: 'rotate(-20.96deg)',
          transformOrigin: 'center center'
        }}
      />

      {/* Content Overlay */}
      <div className="relative z-10 h-full flex items-center justify-center">
        <div className="text-center text-white">
          <h2 className="text-3xl md:text-4xl font-semibold mb-4">
            Transform never-ending roadmaps into week-long wins
          </h2>
        </div>
      </div>
    </section>
  );
};

export default ImageSection;
